    results["1a ≠ b"] = "<math class=\"unicodemath\" xmlns=\"http://www.w3.org/1998/Math/MathML\" display=\"block\"><mrow><mi>𝑎</mi><mo>≠</mo><mi>𝑏</mi></mrow></math>";
